  false,\n\t\"url\": null,\n\t\"notes\": \"In accordance with 43 CFR Part 11 of the
  Code of Federal Regulations, as published in the August 1, 1986 Federal Register,
  a determination has been made as a part of the preassessment screening process that
  criteria listed as 1 through 5 under Section 11.23(e) have been or could be satisfactorily
  met. 1. A release of PCBs occurred prior to and continuous through the implementation
  of CERCLA. 2. Natural resources under the trusteeship of the U.S. Fish and Wildlife
  Service and other state and federal agencies are likely to have been adversely affected.
  3. The quantity of PCBs is sufficient to have caused and continue to cause injury
  to natural resources. 4. Data sufficient to pursue a damage assessment currently
  exists and, with a minor investment, the answers to key questions about PCB toxicity
  can be answered. 5, Currently, it is unclear whether the proposed cleanup is sufficient
  to eliminate any further damages to natural resources. Data from experiments conducted
  to determine the effects of PCBs on fish egg and fry survival will aid in determining
  if the proposed cleanup plan is sufficient to eliminate natural resource injury.\",\n\t\"license_title\":
